import React from "react";

function TrendingQuizBox() {
  return (
    <div
      style={{
        height: "10vh",
        width: "14vw",
        backgroundColor: "white",
        marginLeft: "3vw",
        marginTop:"3vh",
        borderRadius:"5px",
        fontWeight:"600",
      }}
    >
     <p style={{color:"#474444"}}>Quiz 1</p>
     <p>Created on : 04 Sep, 2023</p>
    </div>
  );
}

export default TrendingQuizBox;
